import React, {useState, FormEvent} from 'react'
import PageHeader from '../../components/PageHeader';
import Input from '../../components/Input';

import warningIcon from '../../assest/images/icons/warning.svg'
import './styles.css';
import Textarea from '../../components/Textarea';
import Select from '../../components/Select';




function TeacherForm(){

    const [name, setName] = useState('');
    const [avatar, setAvatar] = useState('');
    const [whatsapp, setWhatsapp] = useState('');
    const [bio, setBio] = useState('');

    const [subject, setSubject ] = useState('');
    const [cost, setCost] = useState('');


    const [scheduleItems, setScheduleItems] = useState([
        {
            week_day:0,
            from:'',
            to:''
        }
    ]);


    function addNewScheduleItem(){


        setScheduleItems([
            ...scheduleItems,
            {
                week_day:0,
                from:'',
                to:''
            }
        ]);
    }


    // funcao para conectar com o back
    function handleCreateClass(e: FormEvent){
        e.preventDefault();
        console.log({
            name, avatar,whatsapp,bio, subject,cost
        });

    }


    return (
    <div id="page-teacher-form" className="container">
        <PageHeader 
            title="Que incr칤el que voc칡 quer dar aula."
            description = "O primeiro passo 칠 preencher esse formu치rio de inscri칞칚o" 

        />

        <main>
            <form onSubmit={handleCreateClass}>
            <fieldset>
                <legend>Seus dados</legend>
                <Input  name="nome" 
                        label="Nome completo" 
                        value={name} 
                        onChange={(e) => {setName(e.target.value)}}
                />

                <Input 
                        name="avatar" 
                        label="Avatar"
                        value={avatar} 
                        onChange={(e) => {setAvatar(e.target.value)}}
                />


                <Input 
                        name="whatsapp" 
                        label="WhatsApp"
                        value={whatsapp} 
                        onChange={(e) => {setWhatsapp(e.target.value)}}
                />

                <Textarea 
                        name="bio" 
                        label="Biografia"
                        value={bio} 
                        onChange={(e) => {setBio(e.target.value)}}
                />
            </fieldset>

            <fieldset>
                <legend>Sobre a aula</legend>
                <Select 
                    name="subject" 
                    label="Mat칠ria"
                    value={subject} 
                    onChange={(e) => {setSubject(e.target.value)}}
                    option = {[
                        {value:'Data Science', label:'Data Science'},
                        {value:'Machine Learning', label:'Machine Learning'},
                        {value:'Matem치tica', label:'Matem치tica'}
                    ]}

                />
                <Input  name="cost" 
                        label="Custo por hora aula"
                        value={cost} 
                        onChange={(e) => {setCost(e.target.value)}}
                />
            </fieldset>

            <fieldset>
                <legend>
                    Hor치rios dispon칤veis  
                    <button type='button' onClick={addNewScheduleItem}>
                            + Novo Hor치rio
                    </button>
                </legend>

                {scheduleItems.map(scheduleItem =>{
                    return(
                        <div key={scheduleItem.week_day} className="schudele-item">
                <Select 
                    name="subject" 
                    label="Mat칠ria"
                    option = {[
                        {value:'Data Science', label:'Data Science'},
                        {value:'Machine Learning', label:'Machine Learning'},
                        {value:'Matem치tica', label:'Matem치tica'}
                    ]}

                />
                <Input name="from" label="Das" type="time"/>
                <Input name="to" label="At칠" type="time"/>

                </div>
                    );
                } )}

            </fieldset>

            <footer>
                <p>
                    <img src={warningIcon} alt="Aviso Importante"/>
                    Importante <br />
                    Preencha todos os dados
                </p>
                <button type="submit">
                    Salvar Cadastro
                </button>
            </footer>
            </form>
        </main>

    </div>

    )
}

export default TeacherForm;
